window.bookSummaryJSON = "<p>Seoafin Wilde was taught by her parents that every breath was a treasure and to seek every adventure she could find. She learns this lesson the hard way after they perish in a plane crash. When she discovers there’s a parallel universe where every person has a twin, she finds a witch who can send her there so she can see her parents again.</p> <p>And have the adventure of a lifetime.</p> <p>Upon arrival in the winter wonderland of Lunwyn, Finnie realizes she’s been played and finds herself walking down the aisle to wed The Drakkar.</p> <p>Instantly thrown into inauspicious circumstances, with years of practice (she did survive that elephant stampede), Finnie bests the challenges and digs into her adventure.</p> <p>But as Frey Drakkar discovers the woman who is his new wife is not Princess Sjofn, a woman he loathes, but instead his Finnie, a free spirit with a thirst for venture just like him, without her knowledge, he orders his new bride bound to his frozen world…</p> <p>Everlasting.</p>"; 
